import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';


const Nav = () => {
    const counter = useSelector(state => state.counter);
    const user = useSelector(state => state.who);
    const clicks = useSelector(state => state.clicks);
    return(

        <div className="nav">
            <div className="nav-container">
                <div className="hi">Hello {user}!</div>
                <p>Counter: {counter}</p>
                <p>You've clicked {clicks} times on this website</p>
                <Link to="/"> <button>ME</button> </Link>
                <Link to="/school"> <button>WHAT I LEARNED</button> </Link>
                <Link to="/jobs"> <button>WHAT I DID</button> </Link>
                <Link to="/passions"> <button>WHAT I LIKE</button></Link>
                <Link to="/redux"> <button>REDUX</button> </Link>
                {user!== 'guest' ? <Link to="/name"><button>NICE NAME</button></Link> : null }
            </div>

        </div>
    )
}

export default Nav;
